import React from 'react';
import './Badge.scss';

export default function Badge(props) {
    return (
        <div id="badge">
            <div className="container">
                <div id="badge--div" className="col">
                    <h2>Badge</h2>
                    {/*  Photo*/}
                    {/* Rank */}
                    {/* Total Score */}
                    {/* Games */}
                    {/* Achievements */}
                </div>
                <div className="row">
                    <h2>Wins</h2>
                </div>
            </div>
        </div>
    )
}

// class Badge
